import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    // Lightweight fetch wrapper to detect API availability
    {(() => {
      if (typeof window !== 'undefined' && typeof window.fetch === 'function') {
        const origFetch = window.fetch.bind(window);
        window.fetch = async (...args) => {
          try {
            const res = await origFetch(...args);
            const url = String(args[0] || '');
            if (url.startsWith('/api/')) {
              if (!res.ok) window.dispatchEvent(new CustomEvent('api-down'));
              else window.dispatchEvent(new CustomEvent('api-ok'));
            }
            return res;
          } catch (e) {
            const url = String(args[0] || '');
            if (url.startsWith('/api/')) window.dispatchEvent(new CustomEvent('api-down'));
            throw e;
          }
        };
      }
    })()}
    <App />
  </React.StrictMode>
);
